This map is an index of the 1:250,000 topo maps of Argentina held in the Map Room at the Arthur Lakes Library, Colorado School of Mines.&lt;/br&gt;&lt;/br&gt;

The Library &lt;b&gt;OWNS&lt;/b&gt; the sheets &lt;b&gt;HIGHLIGHTED IN YELLOW&lt;/b&gt;.&lt;/br&gt;&lt;/br&gt;

See the maps in the Library's catalog: http://catalyst.coalliance.org/vwebv/holdingsInfo?&amp;bibId=310004
